import "./assets/About.css";

const About = () => {
  return (
    <div className="about">
      <h2 style={{ marginBottom: 15 + "px" }}>About</h2>
      <h3>Full Name : Trần Hữu Toàn</h3>
      <h3>Age : 19</h3>
      <h3>Contact me on</h3>
      <h3>Facebook : </h3>
      <a href="https://www.facebook.com/huutoan02">
        https://www.facebook.com/huutoan02
      </a>
      <h3>Github : </h3>
      <a href="https://github.com/huutoan02">https://github.com/huutoan02</a>
      <h3>Source Code : </h3>
      <a href="https://github.com/huutoan02/ReactJS">
        https://github.com/huutoan02/ReactJS
      </a>
      <h3>Instagram : </h3>
      <a href="https://www.instagram.com/htoan.js">
        https://www.instagram.com/htoan.js
      </a>
    </div>
  );
};

export default About;
